    public void ShouldVerifySignaturesCorrectly(DilithiumParameterSet parameterSet, bool expectedVerify, string pkHex, string messageHex, string signatureHex)
    {
        var message = new BitArray(new BitString(messageHex).ToBytes());
        var signature = new BitString(signatureHex).ToBytes();
        var pk = new BitString(pkHex).ToBytes();
        
        var dilithium = new Dilithium(new DilithiumParameters(parameterSet), new NativeShaFactory(), new EntropyProvider(new Random800_90()));
        var verify = dilithium.Verify(pk, signature, message);
        
        Assert.AreEqual(expectedVerify, verify, "verify");
    }

    [Test]
    [TestCase(1)]
    [TestCase(2)]
    [TestCase(-1)]
    [TestCase(-2)]
    public void ShouldComputeNttAndNttInverse(int value)
    {
        var param = new DilithiumParameters(DilithiumParameterSet.ML_DSA_44);
        var dilithium = new Dilithium(param, new NativeShaFactory(), new EntropyProvider(new Random800_90()));
        
        var a = new int[256];
        for (var i = 0; i < 256; i++)
        {
            a[i] = value;
        }

        var aHat = dilithium.NTT(a);
        
        var cHatInverse = dilithium.NTTInverse(aHat);
        for (var i = 0; i < 256; i++)
        {
            Assert.AreEqual(a[i].PosMod(param.Q), cHatInverse[i]);
        }
    }

