    [Test]
    [Ignore("stress test")]
    [TestCase(DilithiumParameterSet.ML_DSA_44)]
    [TestCase(DilithiumParameterSet.ML_DSA_65)]
    [TestCase(DilithiumParameterSet.ML_DSA_87)]
    public void StressTest(DilithiumParameterSet param)
    {
        var dilithium = new Dilithium(new DilithiumParameters(param), new NativeShaFactory(), new EntropyProvider(new Random800_90()));
        var rand = new Random800_90();

        var i = 0;
        while (i < 1000)
        {
            var seed = rand.GetRandomBitString(256);
            try
            {
                var result = dilithium.GenerateKey(seed.Bits);
            }
            catch (IndexOutOfRangeException)
            {
                Assert.Fail(seed.ToHex());
            }

            i++;
        }
        
        Assert.Pass();
    }
